import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Link,
  Switch,
} from 'react-router-dom'

function App() {
  return (
    <div>
      <h1>Mon Application React</h1>
      <p>Bienvenue dans mon application React.</p>
    </div>
  );
}

export default App;
